import React from 'react';

class Sidebar extends React.Component {
  render() {
    return (
      <div className="sidebar">
        <h2>Sidebar</h2>
        <ul>
            <li>Products</li>
            <li>Users</li>
            <li>Communities</li>
            <li>Notifications</li>
        </ul>
      </div>
    );
  }
}

export default Sidebar;
